using std::endl;
using std::cin;
#include <NTL/ZZ.h>
using NTL::ZZ;
using NTL::conv;

ZZ euclides(ZZ r1, ZZ r2);

int main(){
	ZZ a ();
	ZZ b ();
	ZZ mcd (euclides(a,b));
	cout<<mcd<<endl;
}

ZZ euclides(ZZ r1, ZZ r2){
	ZZ q,r;
	while(r2>0){
		q = r1/r2;
		r = r1 - (q*r2);
		r1 = r2;
		r2 = r;
	}
	return r1;
}
